import{_ as e,o as r,c as a,O as t}from"./chunks/framework.9482e208.js";const _=JSON.parse('{"title":"§ 19.2-76.3 Failure to appear on return date for summons issued under § 19.2-76.2.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/19.2-76.3.md","filePath":"vacode/19.2-76.3.md"}'),n={name:"vacode/19.2-76.3.md"},o=t('<h1 id="§-19-2-76-3-failure-to-appear-on-return-date-for-summons-issued-under-§-19-2-76-2" tabindex="-1">§ 19.2-76.3 Failure to appear on return date for summons issued under § 19.2-76.2. <a class="header-anchor" href="#§-19-2-76-3-failure-to-appear-on-return-date-for-summons-issued-under-§-19-2-76-2" aria-label="Permalink to &quot;§ 19.2-76.3 Failure to appear on return date for summons issued under § 19.2-76.2.&quot;">​</a></h1><p>A. If any person fails to appear on the date of the return contained in the summons issued in accordance with § <a href="http://law.lis.virginia.gov/vacode/19.2-76.2/" target="_blank" rel="noreferrer">19.2-76.2</a>, then a summons shall be delivered to the sheriff of the county, city, or town or to another authorized process server for service on that person as set out in § <a href="http://law.lis.virginia.gov/vacode/8.01-296/" target="_blank" rel="noreferrer">8.01-296</a>.</p><p>B. If such person then fails to appear on the date of return as contained in the summons so issued, a summons shall be executed in the manner set out in § <a href="http://law.lis.virginia.gov/vacode/19.2-76/" target="_blank" rel="noreferrer">19.2-76</a>.</p><p>C. No proceedings for contempt or arrest of any person summoned under the provisions of this section shall be instituted unless such person has been personally served with a summons and has failed to appear on the return date contained therein.</p><p>1983, c. 254; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0642" target="_blank" rel="noreferrer">642</a>; 2016, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0242" target="_blank" rel="noreferrer">242</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?161+ful+CHAP0354" target="_blank" rel="noreferrer">354</a>.</p>',5),s=[o];function i(l,d,u,p,c,h){return r(),a("div",null,s)}const m=e(n,[["render",i]]);export{_ as __pageData,m as default};
